d = data.data;
%d(d==-9999) = NaN;
%d(isnan(d))=-1;

x = (1:cellsize:ncols*cellsize) + xllcorner;
y = (nrows*cellsize:-cellsize:1) +yllcorner;

% reduce the resolution by taking every nth datapoint
