Y=y(1:15:end);
BATHY=d(1:15:end,1:15:end);

Nrows=length(Y);
Ncols=length(X);
x_grid = ones(Nrows,1)*X;
y_grid = Y'*ones(1,Ncols);

% convert to Lat and lon coordinates
LAT = nan(size(x_grid));
LON = nan(size(x_grid));
[LAT(:),LON(:)] = utm2deg(x_grid(:), y_grid(:), char(ones(numel(x_grid),1)*'10 N')); % 10N bc is the UTM zone of Northern CA

figure; contour(LON, LAT, BATHY,[0,0],'color','k');

